import React from 'react';
import '../../styles/components/About.css';

function About() {
  return (
    <section id="about" className="about">
      <h2>About Me</h2>
      <div className="about-content">
        <img src="https://via.placeholder.com/300" alt="Profile" className="profile-pic" />
        <div className="about-text">
          <p>Hello! I'm John Doe, a passionate full-stack developer with experience in React, Node.js, and more. I love creating web applications that solve real-world problems.</p>
          <p>When I'm not coding, you can find me hiking, reading tech blogs, or contributing to open-source projects.</p>
        </div>
      </div>
    </section>
  );
}

export default About;
